import React from "react";
import Header from "./Header/Header";
import GeneralInfo from "./General-info-section/GeneralInfo";
import Footer from "./Footer/Footer";
import OrdersInfo from "./Orders-info/OrdersInfo";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path="/">
          <main>
            <GeneralInfo />
            <OrdersInfo />
          </main>
        </Route>
        <Route path="/contact">
          <main>
            <GeneralInfo />
            <OrdersInfo />
          </main>
        </Route>
      </Routes>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
